import { Container } from "react-bootstrap";
import "../styles/css/Home.css";

const Home = () => {
  return (
    <>
      <Container fluid className="home-main">
        <Container className="home-title">
          <h1>Hi, I am Full Stack Developer !</h1>
          <h6 className="">Akhilesh Kumbar</h6>
        </Container>
      </Container>
    </>
  );
};
export default Home;
